script: |
  super -f text -I q2693.spq | sort > q2693.out

inputs:
  - name: q2693.spq
    data: |
      SELECT ALL tab2.col0 * tab2.col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT col0 BETWEEN col0 * col1 + col0 AND col1;
  - name: tab2

outputs:
  - name: q2693.out
    data: |
      189
      2028
      3002
